    [],nt"revision_timestamp": "2015-01-22T15:57:47.383096",nt"name": "hud-insured-multifamily-properties",nt"isopen":
    false,nt"url": null,nt"notes": "The FHA insured Multifamily Housing portfolio
    consist primarily of rental housing properties with five or more dwelling units
    such as apartments or town houses, but can also be nursing homes, hospitals, elderly
    housing, mobile home parks, retirement service centers, and occasionally vacant
    land. Note that this layer does not include insured hospitals. Also, note that there
    is overlap between this layer and the Multifamily Properties u0096 Assisted layer
    in the Assisted Housing file geodatabase. Roughly 2/3 of the FHA insured Multifamily
    portfolio also participate in a rental subsidy program. To learn more about the
    Multifamily housing programs, please visit the following website: http://portal.hud.gov/hudportal/HUD?src=/program_offices/housing/mfh/progdesc
    Generally speaking, the location of the property is derived from the primary address
    on file. Data included are for projects placed in service through December 2012
    and include all attributes from the Active Property table in Real Estate Management
    System (REMS).",nt"license_title": "License Not Specified",nt"extras":
